import React from "react";
import { css } from "@emotion/css";
import styled from "@emotion/styled";

const MusicCard = styled.div`
  height: 300px;
  width: 200px;
  border-radius: 10px;
  border: 1px solid black;
`;

function Card() {
  return (
    <div>
      <MusicCard></MusicCard>
    </div>
  );
}

export default Card;
